import React from "react";
import Navbar from "./navbar";
import "./App.css";
import userlogo from "./user.png";
import background from "./asfalt-dark.png";

var sectionStyle = {
    backgroundImage: "url(" + background + ")"
};

function App() {
    return (
        <React.Fragment>
            <img src={background} className="main" />
            <div className="main">
                <Navbar></Navbar>
                <title>Add User</title>
                <link rel="stylesheet" type="text/css" href="App.css" />
                <div className="loginbox">
                    <img src={userlogo} className="user" />
                    <h1>Add User</h1>
                    <form>
                        <p>User Name :</p>
                        <input
                            type="text"
                            name="username"
                            placeholder="Enter Username"
                            required
                        />
                        <p>Address :</p>
                        <textarea
                            type="textarea"
                            rows="4"
                            cols="30"
                            name="address"
                            placeholder="Enter Address"
                            required
                        />
                        <input type="text" name="links" placeholder="Enter link" required />
                        <button class="button button1">Submit Query</button>
                    </form>
                </div>
            </div>
        </React.Fragment>
    );
}
export default App;
